description:
पूर्व विधायक मुख़्तार अंसारी साहब आज सुपुर्द-ए-ख़ाक़ कर दिये गये। लेकिन उनकी दुर्भाग्यपूर्ण मौत सरकार से यह सवाल करती रहेगी कि न्यायालय द्वारा सज़ा देने या न देने के फ़ैसले से पहले, सरकारी हिरासत में विचाराधीन क़ैदियों के ख़िलाफ़ तथाकथित षड्यंत्र कैसे सफल हो जाते हैं? इस मामले में माननीय सुप्रीम कोर्ट के जज की निगरानी में एक उच्च स्तरीय जाँच होनी चाहिए ताकि सच्चाई जनता के सामने आये और हमारी न्याय व्यवस्था को ‘धीमा ज़हर’ देने की कोशिश करने वाले तथाकथित षड्यंत्रकारियों का पर्दाफ़ाश हो सके।

#mukhtar 

@kunwar_danish_ali

translated_description:
Former MLA Mukhtar Ansari Saheb was delivered today.But his unfortunate death will continue to ask the government as to how the so -called conspiracy against the prisoners under consideration in government custody before the court's decision or not to punish or not to punish?There should be a high -level inquiry under the supervision of the Honorable Supreme Court judge in this case so that the truth comes to the public and can be exposed to the so -called conspirators who try to give 'slow poison' to our judicial system.

#Mukhtar

